import React, { useState } from 'react'
import Navbar from '../Components/Navbar'

const HomePage = () => {
  const [theme,setTheme] = useState('light');
  return (
    <div>
        <Navbar theme={theme} setTheme={setTheme}/>
    </div>
  )
}

export default HomePage
